import React, { useState }  from 'react';
import '../../App.css';
import '../Login.css';
import Button from 'react-bootstrap/Button';
import Col from 'react-bootstrap/Col';
import Form from 'react-bootstrap/Form';
import Row from 'react-bootstrap/Row';
import { Link } from 'react-router-dom';

//Bootstrap and jQuery libraries
import 'bootstrap/dist/css/bootstrap.min.css';



const styles = {
    span:{
      color:"red"
    }
};

export default function DeptLogin() {
    const [validated, setValidated] = useState(false);
  return (
    <>
     <div className='m-3 m-lg-4'>
    <div className="breadcrumb mt-2 ">
      <Link to={'/'}>Dashboard</Link>&nbsp; Â» &nbsp;<span>Reports</span>
    </div>
    <center>
      <h3 className='mt-sm-5'> RO Inspection Reports</h3>
    </center>
    <Form noValidate validated={validated}>
    <div id="progress_report" style={{textAlign: "center", padding: "0.5%", backgroundColor: "#FFE0E1"}}>You are watching data from </div>
      <Row className="mb-3 mt-4">
        <Form.Group as={Col} md="4" controlId="validationCustom01">
          <Form.Label>From Date *</Form.Label>
          <Form.Control
            required
            type="email"
            placeholder="Email Id"

          />
           <Form.Control.Feedback type="invalid">
           Please provide From Date
            </Form.Control.Feedback>
        </Form.Group>
        <Form.Group as={Col} md="4" controlId="validationCustom02">
          <Form.Label>To Date</Form.Label>
          <Form.Control
            required
            type="password"
            placeholder="Enter Password"

          />
          <Form.Control.Feedback type="invalid">
            Please provide To Date
          </Form.Control.Feedback>
        </Form.Group>
        <Form.Group as={Col} md="4" controlId="validationCustom02">
          <Button className="mt-4" type="submit" id="inspection_report" >View Reports</Button>
        </Form.Group>
      </Row>
    </Form>
    </div>
    </>
  )
}
